import React from 'react';
import weyeLogo from './eye_w.webp';

function Header() {
    return (
        <header className="header">
            <div className="header-content" style={{ display: 'flex', alignItems: 'center' }}>
                {/* Frame 17 */}
                <div style={{
                    width: '100%',
                    height: '10%',
                    background: '#005BBB'
                }}></div>

                {/* InSight */}
                <div style={{
                    fontFamily: 'Crimson Text',
                    fontStyle: 'normal',
                    fontWeight: '400',
                    fontSize: '40px',
                    lineHeight: '100%',
                    letterSpacing: '-0.01em',
                    color: '#E4E4E4',
                    display: 'flex',
                    alignItems: 'center'
                }}>
                    InSight
                    <img src={weyeLogo} alt="Eye" style={{ marginLeft: '10px', height: '40px', width: '40px' }} />
                </div>

                {/* Rest of your header content */}
                {/* Sign Up */}
                <a href="https://www-student.cse.buffalo.edu/CSE442-542/2024-Spring/cse-442ac/Signup/" style={{
                    width: '8%',
                    height: '6%',
                    background: '#FFFFFF',
                    fontSize: '20px',
                    fontWeight: '700',
                    borderRadius: '9.26822px',
                    color: '#000000',
                    textDecoration: 'none'
                }}>
                    <button style={{
                        background: 'transparent',
                        border: 'none',
                        padding: '0',
                        margin: '0',
                        fontFamily: 'inherit',
                        fontSize: 'inherit',
                        fontWeight: 'inherit',
                        color: 'inherit',
                        cursor: 'pointer'
                    }}>Sign Up</button>
                </a>

                {/* Sign Up */}
                <a href="https://www-student.cse.buffalo.edu/CSE442-542/2024-Spring/cse-442ac/Login/" style={{
                    fontFamily: 'Crimson Text',
                    width: '8%',
                    height: '6%',
                    color: '#FFFFFF',
                    fontSize: '20px',
                    fontWeight: '400',
                    textDecoration: 'none',
                    marginLeft: '10px'
                }}>Log In</a>

                 {/* Sign In */}

                 <a style={{
                    fontFamily: 'Crimson Text',
                    width: '8%',
                    height: '6%',
                    color: '#FFFFFF',
                    fontSize: '20px',
                    fontWeight: '400',
                    textDecoration: 'none',
                    marginLeft: '10px'
                }}>Help</a>
            </div>
        </header>
    );
}

export default Header;
